import { react, Component} from 'react'
import {Route, BrowserRouter as Router, Switch} from 'react-dom'
import login from './pages/login'

class App extends Component{
  render(){
	  return(			
			<Router>
			    <h2>inside app</h2>	
			    <div className = 'App'>
				<Switch>
				  <Route path = '/login'></ Route>	
				</Switch>
			    </div>	
			</Router>
		)
	}
}

export default App
